            },
            {
              id: 3,
              firstName: 'Shubham',
              lastName: 'G',
              email: 'shubham@iu.edu'
            }
          ]
        }
    }

    render(){

        return(
        <div className="backGroundSAT">
            <AdminNavBar/>
        </div>
        );

    }
};

export default CourseDetails;
